this.imagePreview = function(){			
    var xOffset = 130 , yOffset = 30;
    
    $(".topList a").hover(function(e){
         
        $("#preview").remove();                  
        $(this).addClass('hover'); var src=$(this).attr('src_data');
        if (!(src === undefined || src === null || src=="") ) {
	    $("#avm_cont_page_left").append('<div id="preview" city="'+$(this).attr("city")+'"><img src="https://www.themarianapparitions.org/img/'+src+'" /></div>');							 
	    $("#preview").css("top",(e.pageY - xOffset) + "px").css("left",(180) + "px").fadeIn("fast").click(function (e) {
                    obj_js.active=$(this).attr("city"); active_flag();  active_list_city_js();   e.preventDefault();   e.stopPropagation();
                    $("#preview").remove();return false;})
        }
        if(obj_js.clickEvent!="click"){ $(".topList .hover").each(function(){ $(this).removeClass('hover');}); $(this).addClass('hover');}
        },function(){
            if(obj_js.clickEvent=="click"){
                $(this).removeClass('hover');$("#preview").remove();
            }
    });	
    $(".topList a").mousemove(function(e){$("#preview").css("top",(e.pageY - xOffset) + "px").css("left",(180) + "px");});
    $(".topList a").click(function(e){
                         $(".topList .active").each(function(){ $(this).removeClass('active');}); $(this).addClass('active'); 
                         obj_js.active=$(this).attr("city"); active_flag(); active_list_city_js();   e.preventDefault();   e.stopPropagation(); $("#preview").remove();                
                         return false;
                         });
};

