function resize_photo($img,$cont,off_horz,off_vert){
    var ww=$cont.width()-off_horz,  wh=$cont.height()-off_vert,
                         iw=$img.width(), ih=$img.height(),  rw = wh / ww,    ri = ih / iw, newWidth,  newHeight, properties;
                         //if (rw > ri) { newWidth = wh / ri;   newHeight = wh; } else {  newWidth = ww; newHeight = ww * ri;}
                          newWidth = wh / ri;  newHeight = wh;
                          if (rw > ri) {  newWidth = ww;  newHeight = ww * ri; } else {newWidth = wh / ri; newHeight = wh;}
                          properties = {width: newWidth + "px", height: newHeight + "px", top: "auto", bottom: "auto", left: "auto", right: "auto" };
                         $img.css(properties);
                         var w=$('#avm_photo').width()-$('#avm_photo img').width();
                         $("#cont_thumbs_img_prev").width((w>291)?291:w);
                        $("#cont_thumbs_img_prev").css({"height":(obj_js.height-32-50-132-5),"left":$('#avm_photo img').width()+10 });
}
